import logo from "./logo.svg";
import "./App.css";
import { Box } from "@mui/material";

function App() {
  return (
    <div className="App">
      <Box
        sx={{
          width: "100%",
          backgroundColor: "#1c4ed8",
          justifyContent: "space-between",
          flexDirection: "row",
          display: "flex",
          alignItems: "center",
          padding: "32px",
        }}
      >
        <Box>Finance Tracker</Box>
        <Box>Balance: 0TRY</Box>
      </Box>
      <Box sx={{ display: "flex", flexDirection: "row", height: "100%" }}>
        <Box sx={{ width: "25%", backgroundColor: "red" }}></Box>
        <Box sx={{ width: "75%", backgroundColor: "blue" }}></Box>
      </Box>
    </div>
  );
}

export default App;
